import './profile.scss'

const Profile = () => {
  return (
    <div className='profile'>
      <div className="images">
        <img src="https://www.pexels.com/photo/food-landscape-people-apple-14981258/" alt="" className="cover" />
        <img src="" alt="" className="profilePic" />
      </div>
    </div>
  )
}

export default Profile
